import React from "react"
import Joke from "./Joke"
import jokesData from "./jokesData"

function MyApp(){
    const jokeComponents = jokesData.map(joke => <Joke question={joke.question} answer={joke.answer} />)
    
    return (
        <div>
            {jokeComponents}
        </div>
    )
}

export default MyApp
